import React, {Component} from "react"
import Social from '../components/Social'

class Home extends Component{
    render(){
        return(
            <div className="condiv home">
                <img src="" alt="profile" className="ProfilePic"/>
                <p className="typingeffect">I'm a Web Developer</p>
                <Social />
            </div>
        )
    }
}

export default Home;
